import React, { useState } from 'react';
import InicioIcon from './icons/InicioIcon'; // Asegúrate de importar correctamente los iconos
import MensajeIcon from './icons/MensajeIcon';
import TodoListIcon from './icons/TodoListIcon';
import UsuarioIcon from './icons/UsuarioIcon';
import ConfiguracionIcon from './icons/ConfiguracionIcon';
import ActivosIcon from './icons/ActivosIcon';
import ProveedoresIcon from './icons/ProveedoresIcon';
import SalidaActivosIcon from './icons/SalidaActivosIcon';
import CerrarSesionIcon from './icons/CerrarSesionIcon';

const Menu = () => {
  const [isActivosVisible, setIsActivosVisible] = useState(true); // Estado para controlar visibilidad de las opciones de Activos
  const [isCollapsed, setIsCollapsed] = useState(false); // Estado para controlar si el menú está colapsado

  // Manejador de clic para el botón "Inicio"
  const handleInicioClick = () => {
    setIsActivosVisible(false); // Ocultar las opciones de Activos cuando se hace clic en "Inicio"
  };

  // Manejador de clic para la opción "Activos"
  const handleActivosClick = () => {
    setIsActivosVisible(true); // Mostrar las opciones de Activos
  };

  return (
    <div>
      <ul className="menu">
        <li onClick={handleInicioClick}>
          <img src={InicioIcon} alt="Inicio" className="menu-icon" />
          {!isCollapsed && 'Inicio'}
        </li>
        <li>
          <img src={MensajeIcon} alt="Mensajes" className="menu-icon" />
          {!isCollapsed && 'Mensajes'}
        </li>
        <li>
          <img src={TodoListIcon} alt="Lista de tareas" className="menu-icon" />
          {!isCollapsed && 'Lista de tareas'}
        </li>
        <li>
          <img src={UsuarioIcon} alt="Usuarios" className="menu-icon" />
          {!isCollapsed && 'Usuarios'}
        </li>
        <li>
          <img src={ConfiguracionIcon} alt="Configuración" className="menu-icon" />
          {!isCollapsed && 'Configuración'}
        </li>
        <li onClick={handleActivosClick}>
          <img src={ActivosIcon} alt="Activos" className="menu-icon" />
          {!isCollapsed && 'Activos'}
        </li>
        <li>
          <img src={ProveedoresIcon} alt="Proveedores" className="menu-icon" />
          {!isCollapsed && 'Proveedores'}
        </li>
        <li>
          <img src={SalidaActivosIcon} alt="Salida de Activos" className="menu-icon" />
          {!isCollapsed && 'Salida de Activos'}
        </li>
        <li>
          <img src={CerrarSesionIcon} alt="Cerrar sesión" className="menu-icon" />
          {!isCollapsed && 'Cerrar sesión'}
        </li>
      </ul>

      {/* Opciones de Activos */}
      {isActivosVisible && (
        <div className="opciones-activos">
          <div className="opcion">
            <span>Asignación de Activos</span>
          </div>
          <div className="opcion">
            <span>Solicitud de Activos</span>
          </div>
          <div className="opcion">
            <span>Información de Activos</span>
          </div>
          <div className="opcion">
            <span>Depreciación de Activos</span>
          </div>
        </div>
      )}
    </div>
  );
};

export default Menu;
